function importUserDatas(data) {
  let  promise = [];
  _.each(data, function (val) {
    try {
      promise.push(
        new Promise(function (resolve, reject) {
          models.User.create(val).then(function (result) {
            resolve();
          });
        })
      );
    } catch (err) {
      debug(`ERROR from importPositionCategory: %j`, err);
    }
  });
  return Promise.all(promise);
}
